"use strict";class GraphicsObject{constructor(node){this.__init=()=>{this.node.addEventListener("mouseover",(e=>{this.node.setAttribute("hover","");var p=this.node.parentElement;while(p.classList.contains("graphics-object")){p.removeAttribute("hover");p=p.parentElement}e.stopPropagation()}));this.node.addEventListener("mouseout",(e=>{this.node.removeAttribute("hover")}))};this.node=node;this.__init()}}window.addEventListener("load",(e=>{var gsobj=document.querySelectorAll(".graphics-object");gsobj.forEach((element=>new GraphicsObject(element)))}));